import Carousel from 'react-bootstrap/Carousel';

function Carous() {
  return (
    <Carousel style={{backgroundColor:"#FFB4B4"}}>
      <Carousel.Item interval={1000}>
        <img
          className="d-block w-100"
          src="data:image/jpeg;base64,"
          alt="First slide"
        />
        <Carousel.Caption>
          <h3>See You At Movies</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item interval={500}>
        <img
          className="d-block w-100"
          src="https://thumbs.dreamstime.com/b/watching-movie-popcorn-wooden-background-top-view-82892762.jpg"
          alt="Second slide"
        />
        <Carousel.Caption>
          <h3>Get Your Favorite Movie Snack</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="https://wallpapercave.com/wp/wp1946074.jpg"
          alt="Third slide"
        />
        <Carousel.Caption>
          <h2>COMING SOON!</h2>
          <p>
            Nisl consectetur
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default Carous;